import React, {Component} from 'react';

let newFolder= (repo) => (
  `git clone ${repo.http_url}<br/>cd ${repo.project_name}<br/>touch README.md<br/>git add README.md<br/>git commit -m "add README"<br/> git push -u origin master<br/>`
)

let existing = (repo)=>(
  `cd ${repo.project_name}<br/>git init<br/>git remote add origin ${repo.http_url}<br/>git add .<br/>git commit -m "Initial commit"<br/>git push -u origin master<br/>`
)

let existingGit= (repo)=>(
   <div>cd ${repo.project_name}<br/>git remote rename origin old-origingit remote add origin ${repo.http_url}<br/>git push -u origin --all<br/>gitpush -u origin --tags<br/></div>
)

const styles = {
  newFolder:{},
  newFolderText:{},
  existing:{},
  existingText:{},
  existingGit:{},
  existingGitText:{}
}

class NewMessage extends Component{
  constructor(props){
    super(props)
    console.log("new",props.repo);
  }
  render(){
    return(
      <div className="NewMessage" style={{display:"flex",alignItems:"center",flexDirection:"column"}}>
        <div>
          <div className="newFolder"><u>Create New Project from CommandLine</u></div><br/>
          <div>git clone {this.props.repo.http_url}<br/>cd {this.props.repo.project_name}<br/>touch README.md<br/>git add README.md<br/>git commit -m "add README"<br/> git push -u origin master<br/></div>
          <div className="existing" style={styles.existing}><br/><u>Create Project from existing folder</u></div><br/>
          <div>cd {this.props.repo.project_name}<br/>git init<br/>git remote add origin {this.props.repo.http_url}<br/>git add .<br/>git commit -m "Initial commit"<br/>git push -u origin master<br/></div>
          <div className="existingGit" style={styles.existingGit}><br/><u> Push an existing Git Project</u><br/><br/></div>
          <div>cd {this.props.repo.project_name}<br/>git remote rename origin old-origin<br/>git remote add origin {this.props.repo.http_url}<br/>git push -u origin --all<br/>git push -u origin --tags<br/></div>
        </div>
      </div>
    )
  }
}

export default NewMessage;
